import React from 'react';
import Expenses from "./components/Expenses"

function App() {
  const expenses = [
    {id : 'e1', title: 'Book', amount : 94.12, date: new Date(2023, 3, 18)},
    {id : 'e2', title: 'Car Insurance', amount : 294.67, date: new Date(2023, 3, 28)},
    {id : 'e3', title: 'New TV', amount : 799.49, date: new Date(2023, 2, 12)},
    {id : 'e4', title: 'New Desk (wooden)', amount : 450, date: new Date(2022, 8, 8)},
  ]

  return (
    <div>
      <h2>Let's get started!</h2>
      <Expenses items={expenses} />
    </div>
  );
}

export default App;
